import React from 'react';
import './menu.css';
import AssignmentIcon from '@mui/icons-material/Assignment';
import PeopleIcon from '@mui/icons-material/People';
import MeetingRoomIcon from '@mui/icons-material/MeetingRoom';
import ChatBubbleOutlineIcon from '@mui/icons-material/ChatBubbleOutline';
import DvrIcon from '@mui/icons-material/Dvr';
import DashboardCustomizeIcon from '@mui/icons-material/DashboardCustomize';
const Menu = ({ isOpen, toggleMenu }) => {


    return (

        <div className={`menu ${isOpen ? 'open' : ''}`}>
            <button className='getSpecificQueueBtn menuBtn'>
                <PeopleIcon />
                <span className='menuTitle'>תור</span>

            </button>
            <button className='getMessagesBtn menuBtn'>
                <ChatBubbleOutlineIcon />
                <span className='menuTitle'>הודעות</span>

            </button>
            <button className='getReportBtn menuBtn'>
                <AssignmentIcon />
                <span className='menuTitle'>דוחות</span>

            </button>
            <button className='getSpecificQueueBtn menuBtn'>
                <MeetingRoomIcon />
                <span className='menuTitle'>חדרים</span>

            </button>
            <button className='getSpecificQueueBtn menuBtn'>
                <DvrIcon />
                <span className='menuTitle'>מוניטור</span>

            </button>
            <button className='getSpecificQueueBtn menuBtn'>
                <DashboardCustomizeIcon />
                <span className='menuTitle'>פעולות</span>

            </button>
            <button className="toggleMenuBtn" onClick={toggleMenu}>
                מסכים            </button>
        </div>
    );
};

export default Menu;
